import { lazy } from 'react';
import Error404 from '../views/error/error404';
import ItemBranchoffice from '../pages/auth/branchoffice/item-branchoffice';
import PerfilEditar from '../views/auth/perfil/items/perfil-editar';
import VistaUsuario from '../usuario/vista-usuario';
import QrBranchoffice from '../pages/auth/branchoffice/qr-branchoffice';
import VerifyForm from '../views/signup/verify-form';
import CreateSection from '../pages/auth/menu-editar/forms/create-section';
import DeleteSection from '../pages/auth/menu-editar/forms/delete-section';
import EditSection from '../pages/auth/menu-editar/forms/edit-section';
import CreateProduct from '../pages/auth/menu-editar/forms/create-product'
import DeleteProduct from '../pages/auth/menu-editar/forms/delete-product';
import EditRestaurant from '../views/edit_restaurant/edit_restaurant';



// Aqui se importan los componentes que cargan con Lazy ->

const Home = lazy(()=> import ('../pages/home'));
const SignUp = lazy(() => import('../pages/signup'));
const Login = lazy(() => import('../pages/login'));
const Dashboard = lazy(() => import('../pages/auth/dashboard'));
const ListBranchOffice = lazy(() => import('../pages/auth/branchoffice/list_branchoffice'));
const FirstSesion = lazy(() => import('../pages/auth/first-branchoffice/firts_sesion'));
const NewRestaurant = lazy(() => import ('../views/new_restaurant/new_restaurant'))
const Menus = lazy(() => import('../pages/auth/menus/menus'));
const Perfil = lazy(() => import('../pages/auth/perfil/perfil'));
const NuevoMenu = lazy(() => import('../pages/auth/menus/nuevo-menu'))
const MenuEditar = lazy(() => import('../pages/auth/menu-editar/menu-editar'))
const Pass = lazy(() => import('../pages/pass'))
// Arreglo con rutas ->import CreateProduct from '../pages/auth/menu-editar/forms/create-product';





export const Routes = [
    {
        path:'/',
        component:Home,
        exact:true
    },
    {
        path:'/signup',
        component:SignUp,
        exact:true
    },{
        path:'/verify',
        component:VerifyForm,
        exact:true
    },
    {
        path:'/login',
        component:Login,
        exact:true
    },
    {
        path:'/pass',
        component:Pass,
        exact:true
    },
    {
        path:'/dashboard',
        component:Dashboard,
        exact:false,
        subroutes:[
            {
                path:'/dashboard',
                component:ListBranchOffice,
                exact:true,
            },
            {
                path:'/dashboard/first',
                component:FirstSesion,
                exact:true
            },
            {
                path:'/dashboard/nuevasucursal',
                component:NewRestaurant,
                exact:true
            },
            {
                path:'/dashboard/sucursal/:id',
                component:ItemBranchoffice,
                exact:true
            },
            {
                path:'/dashboard/sucursal/:id/editar',
                component:EditRestaurant,
                exact:true
            },
            {
                path:'/dashboard/sucursal/:id/qr',
                component:QrBranchoffice,
                exact:true
            },
            {
                path:'/dashboard/menus',
                component:Menus,
                exact:true
            },
            {
                path:'/dashboard/nuevomenu',
                component:NuevoMenu,
                exact:true
            },
            {
                path:'/dashboard/menu/:menu',
                component:MenuEditar,
                exact:false,
                subroutes:[
                    {
                        path:'/dashboard/menu/:menu/section',
                        component:CreateSection,
                        exact:true,
                    },
                    {
                        path:'/dashboard/menu/:menu/section/:section/delete',
                        component:DeleteSection,
                        exact:true
                    },
                    {
                        path:'/dashboard/menu/:menu/section/:section/editar',
                        component:EditSection,
                        exact:true
                    },
                    {
                        path:'/dashboard/menu/:menu/section/:section/product',
                        component:CreateProduct,
                        exact:true
                    },
                    {
                        path:'/dashboard/menu/:menu/section/:section/product/:product/delete',
                        component:DeleteProduct,
                        exact:true
                    },
                    {
                        path:'/dashboard/menu/:menu/section/:section/product/:product/editar',
                        component:CreateProduct,
                        exact:true
                    },
                ]
            },
            {
                path:'/dashboard/perfil',
                component:Perfil,
                exact:false,
                subroutes:[
                    {
                        path:'/dashboard/perfil/editar',
                        component:PerfilEditar,
                        exact:true
                    }
                ]
            },
            {
                component:Error404
            }
        ]
    },
    {
        path:'/restaurant/:name/:id/table/:table',
        component:VistaUsuario,
        exact:true
    },
    {
        component:Error404
    }
]
